import React, { Fragment } from "react";
import "./Modal.css";

function LoginModal(props) {
  console.log(props.statusTunnel);
  if (!props.statusTunnel) {
    return;
  }

  return (
    <div className="modal-wrapper">
      <form></form>
      <div>Holi cabrones</div>
    </div>
  );
}

export default LoginModal;
